import React, { Component } from 'react';
import "./css/home.css"
import "./js/home.js"
import { Button, Modal, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';








class Index extends Component {


    constructor(props) {
        super(props);
        this.state = {
          modal: false
        };

        this.toggle = this.toggle.bind(this);
      }

      toggle() {
        this.setState({
          modal: !this.state.modal
        });
